// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/// @title TinyRewardFromOwner
/// @notice Tiny random reward (50â€“100 wei) on Sepolia. Owner pre-funds contract.
/// @dev Uses pseudo-randomness. Not secure for high-value scenarios.
contract TinyRewardFromOwner is ReentrancyGuard, Ownable {
    uint256 public constant MIN_REWARD = 50;   // 50 wei
    uint256 public constant MAX_REWARD = 100;  // 100 wei

    address public designatedOwner;
    uint256 private nonce;

    event Deposited(address indexed from, uint256 amount);
    event RewardPaid(address indexed to, uint256 amount, uint256 nonceUsed);
    event OwnerChanged(address indexed oldOwner, address indexed newOwner);
    event Withdrawn(address indexed to, uint256 amount);

    /// @notice NEW: Pass owner to Ownable() base constructor
    constructor(address _designatedOwner) Ownable(msg.sender) {
        if (_designatedOwner == address(0)) {
            designatedOwner = msg.sender;
        } else {
            designatedOwner = _designatedOwner;
        }
        nonce = 0;
    }

    receive() external payable {
        emit Deposited(msg.sender, msg.value);
    }

    fallback() external payable {
        emit Deposited(msg.sender, msg.value);
    }

    function setDesignatedOwner(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "zero addr");
        address old = designatedOwner;
        designatedOwner = _newOwner;
        emit OwnerChanged(old, _newOwner);
    }

    function claimReward() external nonReentrant returns (uint256) {
        uint256 balance = address(this).balance;
        require(balance >= MIN_REWARD, "Insufficient pool");

        uint256 rnd = _random();
        uint256 range = (MAX_REWARD - MIN_REWARD + 1); // 51
        uint256 amount = MIN_REWARD + (rnd % range);   // 50..100

        if (amount > balance) amount = balance;

        (bool sent,) = msg.sender.call{value: amount}("");
        require(sent, "Transfer failed");

        emit RewardPaid(msg.sender, amount, nonce);
        return amount;
    }

    function withdraw(uint256 amount, address payable to)
        external
        onlyOwner
        nonReentrant
    {
        require(amount <= address(this).balance, "Insufficient balance");
        (bool sent,) = to.call{value: amount}("");
        require(sent, "Withdraw failed");
        emit Withdrawn(to, amount);
    }

    function poolBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function _random() private returns (uint256) {
        uint256 r = uint256(
            keccak256(
                abi.encodePacked(
                    block.timestamp,
                    block.prevrandao,
                    block.number,
                    msg.sender,
                    nonce
                )
            )
        );
        nonce++;
        return r;
    }
}

